import { Navs } from './Nav.js'
import { HeaderBar } from './HeaderBar.js'

function App(props) {
  const titles = props.titles;
  return (
    <main className="container-fluid">
      <div><HeaderBar /></div>
      <div className="row">
        <div id="navis">
          <Navs titles={props.titles} />
        </div>
      </div>
    </main>
  );
}

export default App;
